<script>

    $( "#computeButton" ).click(function() {

        var pepComputation = new PeptideComputation();
        var peptides = JSON.parse($("#jsonData").val());
        pepComputation.computeInterPeptideInclusions(peptides);

        var source = "<h4>"+peptides.length+" peptides</h4>";
        var func = function(o) {return o.identifier}
        for (var i in peptides) {
            source += peptides[i].sequence + "(" + peptides[i].length + ")" + "<ul><li>includes: " + peptides[i].include.map(func) + "</li><li>included in: " + peptides[i].includedIn.map(func) + "</li></ul>";
        }
        $("#inclusions").html(source);


    });

</script>
